function Navbar() {
  return (
    
    <nav className="navbar">
      <div className="container">
        <a href="#">Hulk</a>
        <a href="#" class="logo is-active">Mavel</a>
      <a href="#">Venom</a>
      </div>
      
      </nav>
    
  )}
export default Navbar;
